import styled from "styled-components";

export const Wrapper = styled.div`
        padding-top: 15px;
        padding-bottom: 35px;
`;

export const Context = styled.div`
    .titrecategorie{
        padding: 12px;
        font-size: 23px;
        color: #3faba0;
        font-weight: 600;
    }

    .voirPlus {
    text-align: right;
    }   
    .box_list {
    /* background-color: #fff; */
    display: block;
    position: relative;
    margin-bottom: 30px;
    border-radius: 5px;
    /* box-shadow: 0px 0px 30px 0px rgb(0 0 0 / 10%); */

    span{
        background-color: rgba(255, 255, 255, 0.8);
        border-radius: 20px;
        display: inline-block;
        color: #222;
        font-size: 0.75rem;
        padding: 5px 15px;
    }


`;
